import React, { useEffect, useState } from 'react';
import { Slider } from '../../components/Slider/Slider';

import "./Main.css";
import { getLocation } from '../../api/api';

const Main = () => {
  const [timezone, setTimezone] = useState();

  useEffect(() => {
    setTimezone(getLocation)
  })

  return (
    <div>
      <Slider />
      <div className='container'>
        <p>{timezone}</p>
      </div>

    </div>
  );
};

export default Main;
